<#
.SYNOPSIS
Map account sessions at the entire domain endpoints or specific hosts. Both SMB remote sessions (users connected via smb) and interactive (RDP, local, Run As), with No admin permissions needed (optional, admin needed just for interactive logon times only).

.DESCRIPTION
Agentless, "living off the land" script (No dependencies required, e.g. no ActiveDirectory Module needed or RSAT) for mapping user sessions AND SMB open sessions (Remotely, using NetSessionEnum API) in a 'Hacktive Directory' domain.
No special permissions required on domain endpoints (any authenticated user should be OK). requires port 445 to be open on EndPoints (uses Remote Registry w/psloggedon.exe, SysInternals/Microsoft's tool).

By default, tries to query all enabled computer accounts in the domain. Can also specify specific computer(s).

Note: If you need to know whether the interactive session(s) are Active or Disconnected, please use "Get-UserSession" script (https://github.com/YossiSassi/Get-UserSession) - Note that it only shows interactive sessions, not account connected via SMB shares.

.PARAMETER ComputerName
One or more computers to query for interactive and/or SMB sessions connected to them. 
Default is empty/optional - entire domain is queried for all online hosts.

.LINK
Comments welcome to 1nTh35h311 (yossis@protonmail.com)

v1.0.1 - added a warning when path contains space (fixes issue with empty results)
#>
param (
    [cmdletbinding()]
    [parameter(mandatory=$false)]
    [string[]]$ComputerName
)

# general settings
[boolean]$DisaplySessionsToConsole = $false;
$CurrentUserNames = $(whoami.exe), "$env:COMPUTERNAME\$env:USERNAME";
#$CurrentComputerName = ([adsisearcher]"samaccountname=$($env:COMPUTERNAME)$").FindOne().Properties.dnshostname;

$DomainName = ([adsi]'').name;
$ReportFile = "$(Get-Location)\Sessions_$($DomainName)_$(Get-Date -Format ddMMyyyyHHmmss).csv";
$CurrentDirectory = Get-Location;

if (!$ComputerName)
    {
        Write-Host "Querying all enabled & accessible computer accounts in domain $DomainName... (Default)" -ForegroundColor Green;
        # Get all Enabled computer accounts 
        #$Computers = Get-ADComputer -Filter {Enabled -eq 'true'}
        $Searcher = New-Object DirectoryServices.DirectorySearcher([ADSI]"");
        $Searcher.Filter = "(&(objectClass=computer)(!userAccountControl:1.2.840.113556.1.4.803:=2))";
        $Searcher.PageSize = 100000; # by default, 1000 are returned for adsiSearcher. this script will handle up to 100K acccounts.
        $Computers = ($Searcher.Findall());
        $HostsToQuery = $Computers.Properties.dnshostname;
        $TotalCount = $HostsToQuery.Count;
    }
else # specific computer(s) specified
    {
        Write-Host "Querying computers specified. " -NoNewline -ForegroundColor Yellow; Write-Host " Run without any parameters to query ALL computers in domain $DomainName." -ForegroundColor Green;
        $HostsToQuery = $ComputerName;
        $TotalCount = ($ComputerName | Measure-Object).Count;
        $DisaplySessionsToConsole = $true
    }

# function to ensure port 445 is open on destination (quser, qwinsta etc relay on it - queries done over SMB)
filter Invoke-PortPing {((New-Object System.Net.Sockets.TcpClient).ConnectAsync($_,445)).Wait(100)}
#filter Invoke-Ping {(New-Object System.Net.NetworkInformation.Ping).Send($_,100)}

# Save the psloggedon tool into current directory
$EXEstr = '';
$psLoggedOnPath = "$((Get-Location).Path)\PsLoggedOn.exe";

# Ensure there is no space in the folder path
if ($psLoggedOnPath.Contains(" ")) 
    {
        Write-Warning "An error occured while preparing the query tool - File Path: $((Get-Location).path).`nEnsure there is no SPACE in the script path!`nQuiting."
        break
    }

$Bytes = [System.Convert]::FromBase64String($EXEStr);
[System.IO.File]::WriteAllBytes($psLoggedOnPath,$Bytes);

if (!$?)
    {
        Write-Warning "An error occured saving the PsLoggedOn tool into the current directory.`nError reason: $($Error[0].categoryinfo.Reason)`nQuiting.";
        break
    } 

$Lines = @();
$global:SessionList = @();
$global:SessionList += 'Computername,SessionType,UserName,LastSeenTimeSMB,LogonTimeInteractive';
'Computername,SessionType,UserName,LastSeenTimeSMB,LogonTimeInteractive' | Out-File $ReportFile;
[int]$i = 1;

# Get the current Error Action Preference
$CurrentEAP = $ErrorActionPreference;
# Set script not to alert for errors
$ErrorActionPreference = "silentlycontinue";

$HostsToQuery | Foreach {
    $Computer = $_
     Write-Host "Querying $Computer ($i out of $TotalCount)" -NoNewline;

     # Port-Ping the host first, to improve performance/shorten timeout
     # NOTE: if no Firewall blocking SMB 445 on Endpoints, step can be skipped. simply remark it in the code if needed
     if (($Computer | Invoke-PortPing) -eq "True") {
            Write-Host " - Online" -ForegroundColor Green;
            # run command
            $Command = "& $psLoggedOnPath \\$computer -nobanner -accepteula";
            $QueryData = Invoke-Expression $Command;
            
            # parse data & get relevant indexes
            $TempData = $QueryData -replace '\s{2,}', ',';
            [int]$IndexInteractive = $($TempData | Select-String "Users logged on locally:" | select -ExpandProperty Linenumber) - 1;
            [int]$IndexSMB = $($TempData | Select-String "Users logged on via resource shares:" | select -ExpandProperty Linenumber) - 1;
            
            # Get interactive sessions data
            if ($IndexInteractive -ne -1) { # if there are no interactive sessions, or an error occured - SKIP
            $Lines += $TempData[$($IndexInteractive + 1)..$($IndexSMB - 2)] | ForEach-Object {
                $interactive = $_.split(","); 
                if ($($interactive[1]) -like "*<unknown time>*") {$logonTimeInteractive = "RunAs_Or_NoAdminPermissions"} else {$logonTimeInteractive = $($interactive[1])}; 
                "$Computer,Interactive,$($interactive[2]),N/A,$logonTimeInteractive"
                }
            }

            # Get SMB sessions data (users connected via NetsessionEnum)
            $Lines += $TempData[$($IndexSMB + 1)..$($TempData.Count - 1)] | ForEach-Object {
                $smb = $_.split(","); 
                if ($($smb[1]) -like "*<unknown time>*") {$smbIdleTime = "NoAdminPermissions"} else {$smbIdleTime = $($smb[1])};
                # skip session if it is the current user coming from the SMB share
                if ($smb[2] -notin $CurrentUserNames) {
                    "$Computer,SMB,$($smb[2]),$smbIdleTime,N/A"
                }
            }
            
            # write short results to console
            if ($Lines) {$Lines | foreach {Write-Host "$($_.split(",")[2]) has a session at $Computer via $($_.split(",")[1])" -ForegroundColor Cyan}}

            # add data to global session list + update CSV report file
		    $global:SessionList += $Lines;
            $Lines | Out-File $ReportFile -Append;
            
            Clear-Variable QueryData, Tempdata, Lines, interactive, logonTimeInteractive, IndexInteractive, IndexSMB; 
            }

            # otherwise, ping to 445 was unsuccessful, skipping
            else {
                Write-Host " - No response" -ForegroundColor Yellow;
            }
            $i++
    }

## Wrap up & display results
# Set back error preference
$ErrorActionPreference = $CurrentEAP;
Remove-Item $psLoggedOnPath -Force;

[int]$TotalSessionFound = $(($global:SessionList | Measure-Object).Count -1);

if ($TotalSessionFound -ne 0) {
    # convert session data to CSV
    $sessionCSV = $global:SessionList | ConvertFrom-Csv -ErrorAction SilentlyContinue;
    
    # display stats grouped by session types
    $sessionCSV | Group-Object SessionType | select @{n='SessionType';e={$_.Name}}, Count | sort Count -Descending;
    
    Write-Host "`nTotal of $TotalSessionFound sessions found (both SMB and Interactive)" -ForegroundColor Green;
    Write-Host Report file saved to $ReportFile`n -ForegroundColor Gray;

    # check if display sessions to console is on (default when querying with -Computername parameter)
    if ($DisaplySessionsToConsole) {
        $sessionCSV | Format-Table -AutoSize
    }

    if ($global:SessionList.Count -ge 2) {
    # allow in memory query of the collected sessions info
    Do {
        Write-Host "Type the username you wish to see the Session(s) for, or press ENTER to exit:" -ForegroundColor Yellow
        $username = Read-Host
        $sessionCSV | where {$_.username -eq $username -or $_.username.split("\")[1] -eq $username}
        }
        until ($username -eq '')
    }

    Write-Host Type '$global:SessionList' to see the full session list in memory, in CSV format -ForegroundColor Magenta;
}
else {
    Remove-Item $ReportFile;
    Write-Host "No sessions found." -ForegroundColor Yellow;
}
# NOTE: you can use this global variable to query sessions further and/or export them to other formats, e.g. 
# To a grid: $global:SessionList | ConvertFrom-CSV | Out-GridView
# or JSON: $global:SessionList | ConvertFrom-CSV | ConvertTo-Json | Out-File .\Sessions.json